import React from "react";

function Timeline(props) {
  let chirps = props.chirps.map(chirp => {
    return (
      <div className="container mt-4 chirp" key={chirp.chirpId}>
        <h4>
          /chirper/message/
          {chirp.userName}
        </h4>
        <p>{chirp.chirpContent}</p>
      </div>
    );
  });

  return chirps;
}

export default Timeline;
